function startRecording() {
    element = document.createElement("div");
    element.innerHTML = '\
       <div style="display: flex;align-items: center;flex-direction: row;margin: 10px;" id="recording">\
       <img id = "ide-img" src = "data:image/png;base64," >\
       <div id="circle"></div>\
           <span id="content">\
               Recording...\
           </span>\
       </div >\
    ';

    if (window.parent.parent.parent.parent.parent.document.body != null) {
        var avlElement = window.parent.parent.parent.parent.parent.document.getElementById("recording");
        if (typeof(avlElement) == 'undefined' || avlElement == null) {
            window.parent.parent.parent.parent.parent.document.body.appendChild(element);
        }
    }

    var elmnt = window.parent.parent.parent.parent.parent.document.createElement("div");
    elmnt.id = "recordLoading";
    elmnt.innerHTML = 'Processing...<span id="recordLoadingClose" onclick="parent.document.getElementById(\'recordLoading\').style.display = \'none\'">X</span>';
    if (window.parent.parent.parent.parent.parent.document.body != null) {
        var avlElement = window.parent.parent.parent.parent.parent.document.getElementById("recordLoading");
        if (typeof(avlElement) == 'undefined' || avlElement == null) {
            window.parent.parent.parent.parent.parent.document.body.appendChild(elmnt);
        }
    }

    document.getElementById("recording").style = "animation: fadeInAnimation ease 1s;";
    document.getElementById("recording").style = "visibility: visible !important;";
    try {
        refreshRecordingDiv();
    } catch {}

    document.getElementById("recording").addEventListener("mousehover", function(e) {
        if (!isTop) {
            console.log("not top");
            var recorderDisplay = document.getElementById("recording");
            recorderDisplay.classList.add("moveRecordToTop");
            recorderDisplay.remove("moveRecordToBottom");
            // document.getElementById("recording").style.position = "fixed";
            // document.getElementById("recording").style.top = "0";
            // document.getElementById("recording").style.right = "0";
            // document.getElementById("recording").style.bottom = "unset";
            isTop = true;
        } else {
            console.log("top");
            var recorderDisplay = document.getElementById("recording");
            recorderDisplay.classList.remove("moveRecordToTop");
            recorderDisplay.classList.add("moveRecordToBottom");
            // document.getElementById("recording").style.position = "fixed";
            // document.getElementById("recording").style.bottom = "80px";
            // document.getElementById("recording").style.right = "0";
            // document.getElementById("recording").style.top = "90%";
            isTop = false;
        }
    });
    document.getElementById("recordLoading").style.display = "block !important;";
}

function stopRecording() {
    document.getElementById("recording").style = "visibility: hidden !important;";
}

if (document.body != null) {
    window.isRecordingPaused = true;

    startRecording();
}